  `txtPassword` varchar(22) DEFAULT NULL,
  `enumTipo` enum('PROFESOR','ALUMNO','ADMINISTRADOR') DEFAULT NULL,
  PRIMARY KEY (`intIdusuario`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=utf8;

